package practicas;


public class Fibonacci {

	/**
	 Muestra la serie de Fibonacci hasta lo primeros 20
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int numeros[]= new int[20];
		numeros[0]=0;
		numeros[1]=1;
		
		for (int i=2; i>numeros.length; i++);
		
	}

}
